import React, { Component } from 'react';
import './style.css';
import Usuario from './user.jpg';
import Typography from '@material-ui/core/Typography';
import Grid from '@material-ui/core/Grid';
import PersonIcon from '@material-ui/icons/Person';
import LocalAtmIcon from '@material-ui/icons/LocalAtm';
import Button from '@material-ui/core/Button';
import AccountTreeIcon from '@material-ui/icons/AccountTree';
import Footer from '../Footer';
import firebase from "firebase"

// import { Api, JsonRpc, RpcError } from 'eosjs';
// import { Api, JsonRpc, RpcError } from 'eosjs';
// import { JsSignatureProvider } from 'eosjs/dist/eosjs-jssig';

class Profile extends Component {


  componentDidMount = () => {
    firebase.auth().onAuthStateChanged(user => {
      this.setState({ isSignedIn: !!user })
        console.log("user", user)
    })
  }

  constructor(props){
    super(props);
    this.state = {
      usrinfo: []
    }
  }

  render() {

    var user = firebase.auth().currentUser;
    var name, email, photoUrl, uid, emailVerified;

    if (user != null) {
      name = user.displayName;
      email = user.email;
      photoUrl = user.photoURL;
      uid = user.uid;
    }

    getRows = () => {
      fetch('54.163.3.27:5000/createAccount?uid=${uid}&account=${user}')
      .then(res => res.json())
      .then(usrinfo => this.setState({ usrinfo }))
      .then(prt => console.log(prt))
      .catch(err => err)
    }

    //http://54.163.3.27:5000/createAccount?uid=askdfjqkwjerr&account=ricardojmv

    return (
    <div className="page">
        <Footer />
        <div className="header">
            <img className="user-photo" src={photoUrl} />
        </div>

        <div className="detalles">
        <div className="hola">
        <Grid container alignItems="center">
          <Grid item xs>
            <Typography gutterBottom variant="h4">
                {/*Satoshi*/}
            </Typography>
            <Typography gutterBottom variant="h4" >
            {name} 
            </Typography>
          </Grid>
          <Grid item>
            <Typography gutterBottom variant="h6">
            </Typography>
          </Grid>
        </Grid>

        {/*CUENTA */}
        <Grid container alignItems="center" className="cuenta">
            <Grid item xs={1}>
            <PersonIcon color="secondary" />
            </Grid>
            <Grid item>
                <Typography gutterBottom variant="h6">
                    {/*NakaToshi2323*/}
                    {usrinfo[0]}
                </Typography>
            </Grid>
        </Grid>

        {/*Balance */}
        <Grid container alignItems="center" className="cuenta">
            <Grid item xs={1}>
            <LocalAtmIcon color="secondary" />
            </Grid>
            <Grid item>
                <Typography gutterBottom variant="h6">
                    150.0000 MarroCoins
                </Typography>
            </Grid>
        </Grid>

        <Button variant="outlined" color="primary"> Private Key</Button>
        <p> </p>
        <Button variant="outlined" color="primary" onClick={() => firebase.auth().signOut()}>Sign out</Button>
      </div>

        </div>
    </div>
      )
    }
  }


  export default Profile


